{"content": "1\u3001\u6269\u5bb9\u5927\u8dc3\u8fdb\u4e16\u6240\u7f55\u89c1\u3002\u6bcf\u5468\u6309\u90e8\u5c31\u73ed\u5730\u53d1\u884c\u5e76\u4e0a\u5e0210\u53ea\u65b0\u80a1\uff0c\u5df2\u5230\u4e86\u201c\u5373\u5ba1\u5373\u53d1\u201d\u7684\u7a0b\u5ea6\u3002\u8fd1\u65e5\uff0c\u4e0a\u4ea4\u6240\u62ab\u9732\uff1a\u201c\u4eca\u5e74\u5c06\u53d1\u884c\u65b0\u80a1500\u5bb6\uff0c\u878d\u8d443000\u4ebf\u5143\u3002\u201d\u5b9e\u9645\u4e0a\uff0c\u8fd9\u5df2\u7ecf\u662f\u6ce8\u518c\u5236\u7684\u53d1\u884c\u8282\u594f\u4e86\uff0c\u5e76\u4e14\u6bd4\u6ce8\u518c\u5236\u4e0b\u7684\u7f8e\u56fd\u80a1\u5e02\u53d1\u884c\u65b0\u80a1\u7684\u6570\u91cf\u8fd8\u591a5\u500d\u3002\u4e25\u91cd\u7684\u4f9b\u5927\u4e8e\u6c42\uff0c\u4e0d\u65ad\u5730\u964d\u4f4e\u4e8c\u7ea7\u5e02\u573a\u80a1\u7968\u7684\u4ef7\u683c\u6c34\u4f4d\uff0c\u5438\u5e72\u4e86\u539f\u672c\u53ef\u4ee5\u7528\u6765\u63a8\u9ad8\u80a1\u5e02\u7684\u5b58\u91cf\u8d44\u91d1\u548c\u589e\u91cf\u8d44\u91d1\uff0c3200\u70b9\u5e73\u53f0\u6536\u76d8\u4e8664\u5929\uff0c\u90fd\u65e0\u6cd5\u8d8a\u8fc73300\u70b9\u3002<br>2\u3001\u524a\u5f31\u673a\u6784\u6295\u8d44\u8005\u961f\u4f0d\u3002\u7528\u201c\u5bb3\u4eba\u7cbe\u201d\u3001\u201c\u5996\u7cbe\u201d\u3001\u201c\u571f\u8c6a\u201d\u3001\u201c\u91ce\u86ee\u4eba\u201d\u3001\u201c\u902e\u9f20\u3001\u6253\u72fc\u3001\u6293\u5927\u9cc4\u201d\u7b49\u975e\u89c4\u8303\u8bed\u8a00\uff0c\u904f\u5236\u4e3e\u724c\u6f6e\uff0c\u5413\u9000\u4e86\u673a\u6784\u6295\u8d44\u8005\uff0c\u4f7f\u5e02\u573a\u5931\u53bb\u4e86\u6d3b\u529b\u3002<br>3\u3001\u6e05\u67e5\u8fdd\u89c4\u8d44\u91d1\u3002\u7ee7\u65e5\u524d\u94f6\u76d1\u4f1a\u53d1\u6587\u6e05\u7406\u59d4\u5916\u6295\u8d44\uff0c\u5373\u7406\u8d22\u8d44\u91d1\uff1b\u4eca\u4fdd\u76d1\u4f1a\u53c8\u8868\u793a\uff0c\u8981\u4e25\u67e5\u8fdd\u89c4\u8d44\u91d1\u5165\u5e02\uff0c\u52a0\u5267\u4e86\u672c\u5468\u80a1\u5e02\u8d44\u91d1\u7684\u5927\u91cf\u51fa\u9003\u3002<br>4\u3001\u7981\u6b62\u201c\u8de8\u754c\u8d2d\u5e76\u201d\uff0c\u4e25\u5ba1\u8d44\u4ea7\u91cd\u7ec4\u3002\u8fd9\u662f\u5168\u4e16\u754c\u80a1\u5e02\u95fb\u6240\u672a\u95fb\u7684\u3001\u8fdd\u80cc\u5e38\u8bc6\u7684\u89c4\u5b9a\u3002\u8a00\u4e0b\u4e4b\u610f\uff0c\u4f20\u7edf\u80a1\u53ea\u80fd\u6c38\u8fdc\u201c\u4f20\u7edf\u201d\uff0c\u5468\u671f\u7c7b\u80a1\u53ea\u80fd\u6c38\u8fdc\u201c\u5468\u671f\u201d\u3002\u8fd9\u5c82\u4e0d\u662f\u8ba9\u4e2d\u592e\u4e00\u518d\u63d0\u5021\u7684\u4f20\u7edf\u4ea7\u4e1a\u201c\u8f6c\u578b\u5347\u7ea7\u201d\u3001\u201c\u8c03\u7ed3\u6784\uff0c\u8f6c\u65b9\u5f0f\u201d\u3001\u201c\u6df1\u5316\u56fd\u8d44\u56fd\u4f01\u6539\u9769\u201d\uff0c\u6210\u4e3a\u4e00\u53e5\u7a7a\u8bdd\uff1f<br>6\u3001\u9650\u5236\u6c11\u95f4\u8d44\u672c\u6765\u6295\u8d44\u3002\u89c4\u5b9a\u4e0a\u5e02\u516c\u53f8\u65b0\u8d2d\u4e70\u4f18\u8d28\u8d44\u4ea7\uff0c\u4e0d\u5f97\u8d85\u8fc7\u539f\u6709\u8d44\u4ea7\u7684100%\u3002\u54ea\u6015\u662f\u7528\u81ea\u6709\u8d44\u91d1\u8d2d\u4e70\uff0c\u4e5f\u4e0d\u5141\u8bb8\u3002\u8fd9\u7b49\u4e8e\u662f\u963b\u6b62\u6c11\u95f4\u8d44\u672c\u5728\u80a1\u5e02\u6295\u8d44\u7684\u79ef\u6781\u6027\u3002<br>7\u3001\u5c06\u518d\u878d\u8d44\u89c4\u6a21\u9650\u6b7b\u3002\u4e0d\u5206\u9752\u7ea2\u7682\u767d\u7684\u89c4\u5b9a\uff0c\u518d\u878d\u8d44\u4e0d\u5f97\u8d85\u8fc7\u80a1\u672c\u768420%\u3002\u8fd9\u7b49\u4e8e\u662f\u4e3a\u4e0a\u5e02\u516c\u53f8\u8fdb\u884c\u91cd\u5927\u8d44\u4ea7\u91cd\u7ec4\u8bbe\u7f6e\u4e00\u4e2a\u5927\u969c\u788d\u3002<br>8\u3001\u95ee\u8be2\u51fd\u8fc7\u4e8e\u9891\u7e41\u3001\u968f\u610f\u3002\u4ea4\u6613\u6240\u5bf9\u4f01\u4e1a\u8d44\u4ea7\u91cd\u7ec4\u6ca1\u5b8c\u6ca1\u4e86\u5730\u53d1\u95ee\u8be2\u51fd\uff0c\u5228\u6839\u7a76\u5e95\uff0c\u8ffd\u6eaf\u7ec6\u8282\uff0c\u903c\u4e0a\u5e02\u516c\u53f8\u6cc4\u9732\u540e\u7eed\u91cd\u7ec4\u52a8\u4f5c\u673a\u5bc6\uff0c\u4ee4\u8bb8\u591a\u4e0a\u5e02\u516c\u53f8\u54ed\u7b11\u4e0d\u5f97\u3002<br>9\u3001\u7528\u884c\u653f\u547d\u4ee4\u5e72\u6270\u4f01\u4e1a\u7ecf\u8425\u3002\u5982\uff0c\u5b64\u964b\u5be1\u95fb\u5730\u79f0\uff0c\u4e0a\u5e02\u516c\u53f810\u900130\u662f\u5168\u4e16\u754c\u6ca1\u6709\u7684\uff0c\u90fd\u8981\u53d7\u5230\u4e25\u5389\u76d1\u7ba1\uff0c\u5374\u88ab\u767e\u5ea610\u900190\u3001\u82f9\u679c10\u900160\u3001\u817e\u8baf10\u900140\u7684\u9ad8\u9001\u8f6c\u201c\u6253\u8138\u201d\uff0c\u8fdd\u53cd\u4e86\u516c\u53f8\u6cd5\u5173\u4e8e\u201c\u4f01\u4e1a\u6709\u81ea\u4e3b\u7684\u7ecf\u8425\u6743\u548c\u5206\u914d\u6743\u201d\u7684\u89c4\u5b9a\u3002<br>10\u3001\u7ba1\u6da8\u4e0d\u7ba1\u8dcc\u3002\u4e2a\u80a1\u6da820%\uff0c\u5c31\u53d1\u5f02\u5e38\u6ce2\u52a8\u516c\u544a\uff0c\u800c\u8dcc20%\uff0c\u5374\u89c6\u800c\u4e0d\u89c1\u3002\u751a\u81f3\u4ea4\u6613\u6240\u7684\u201c\u7a97\u53e3\u6307\u5bfc\u201d\u8fd8\u5177\u4f53\u5230\u67d0\u80a1\uff08\u5982\u5e7f\u5dde\u6e2f\uff09\u5468\u56db\u4e0d\u80fd\u6da8\u505c\uff0c\u800c\u5bf9\u5468\u4e94\u8dcc\u505c\uff0c\u5374\u4e00\u58f0\u4e0d\u542d\u3002<br>11\u3001\u6267\u6cd5\u4e0d\u516c\u3002\u5bf9\u591a\u6570\u5f02\u52a8\u80a1\uff0c3\u20144\u4e2a\u6da8\u505c\u5c31\u91c7\u53d6\u201c\u7279\u505c\u6838\u67e5\u201d\u7684\u63aa\u65bd\uff0c\u4f46\u5bf920\u591a\u53ea\u201c\u96c4\u5b89\u6982\u5ff5\u80a1\u201d\u8fde\u7eed5\u4e2a\u6da8\u505c\uff0c\u5374\u4e88\u4ee5\u9ed8\u8ba4\u3002\u76f4\u81f3\u7b2c\u516d\u4e2a\u6da8\u505c\uff0c\u6536\u76d8\u524d\u56fd\u5bb6\u961f\u51fa\u5b8c\u8d27\uff0c\u665a\u4e0a\u624d\u5ba3\u5e03\u7279\u505c\uff0c\u6709\u8fdd\u4e09\u516c\u539f\u5219", "text": "1\u3001\u6269\u5bb9\u5927\u8dc3\u8fdb\u4e16\u6240\u7f55\u89c1\u3002\u6bcf\u5468\u6309\u90e8\u5c31\u73ed\u5730\u53d1\u884c\u5e76\u4e0a\u5e0210\u53ea\u65b0\u80a1\uff0c\u5df2\u5230\u4e86\u201c\u5373\u5ba1\u5373\u53d1\u201d\u7684\u7a0b\u5ea6\u3002\u8fd1\u65e5\uff0c\u4e0a\u4ea4\u6240\u62ab\u9732\uff1a\u201c\u4eca\u5e74\u5c06\u53d1\u884c\u65b0\u80a1500\u5bb6\uff0c\u878d\u8d443000\u4ebf\u5143\u3002\u201d\u5b9e\u9645\u4e0a\uff0c\u8fd9\u5df2\u7ecf\u662f\u6ce8\u518c\u5236\u7684\u53d1\u884c\u8282\u594f\u4e86\uff0c\u5e76\u4e14\u6bd4\u6ce8\u518c\u5236\u4e0b\u7684\u7f8e\u56fd\u80a1\u5e02\u53d1\u884c\u65b0\u80a1\u7684\u6570\u91cf\u8fd8\u591a5\u500d\u3002\u4e25\u91cd\u7684\u4f9b\u5927\u4e8e\u6c42\uff0c\u4e0d\u65ad\u5730\u964d\u4f4e\u4e8c\u7ea7\u5e02\u573a\u80a1\u7968\u7684\u4ef7\u683c\u6c34\u4f4d\uff0c\u5438\u5e72\u4e86\u539f\u672c\u53ef\u4ee5\u7528\u6765\u63a8\u9ad8\u80a1\u5e02\u7684\u5b58\u91cf\u8d44\u91d1\u548c\u589e\u91cf\u8d44\u91d1\uff0c3200\u70b9\u5e73\u53f0\u6536\u76d8\u4e8664\u5929\uff0c\u90fd\u65e0\u6cd5\u8d8a\u8fc73300\u70b9\u3002<br>2\u3001\u524a\u5f31\u673a\u6784\u6295\u8d44\u8005\u961f\u4f0d\u3002\u7528\u201c\u5bb3\u4eba\u7cbe\u201d\u3001\u201c\u5996\u7cbe\u201d\u3001\u201c\u571f\u8c6a\u201d\u3001\u201c\u91ce\u86ee\u4eba\u201d\u3001\u201c\u902e\u9f20\u3001\u6253\u72fc\u3001\u6293\u5927\u9cc4\u201d\u7b49\u975e\u89c4\u8303\u8bed\u8a00\uff0c\u904f\u5236\u4e3e\u724c\u6f6e\uff0c\u5413\u9000\u4e86\u673a\u6784\u6295\u8d44\u8005\uff0c\u4f7f\u5e02\u573a\u5931\u53bb\u4e86\u6d3b\u529b\u3002<br>3\u3001\u6e05\u67e5\u8fdd\u89c4\u8d44\u91d1\u3002\u7ee7\u65e5\u524d\u94f6\u76d1\u4f1a\u53d1\u6587\u6e05\u7406\u59d4\u5916\u6295\u8d44\uff0c\u5373\u7406\u8d22\u8d44\u91d1\uff1b\u4eca\u4fdd\u76d1\u4f1a\u53c8\u8868\u793a\uff0c\u8981\u4e25\u67e5\u8fdd\u89c4\u8d44\u91d1\u5165\u5e02\uff0c\u52a0\u5267\u4e86\u672c\u5468\u80a1\u5e02\u8d44\u91d1\u7684\u5927\u91cf\u51fa\u9003\u3002<br>4\u3001\u7981\u6b62\u201c\u8de8\u754c\u8d2d\u5e76\u201d\uff0c\u4e25\u5ba1\u8d44\u4ea7\u91cd\u7ec4\u3002\u8fd9\u662f\u5168\u4e16\u754c\u80a1\u5e02\u95fb\u6240\u672a\u95fb\u7684\u3001\u8fdd\u80cc\u5e38\u8bc6\u7684\u89c4\u5b9a\u3002\u8a00\u4e0b\u4e4b\u610f\uff0c\u4f20\u7edf\u80a1\u53ea\u80fd\u6c38\u8fdc\u201c\u4f20\u7edf\u201d\uff0c\u5468\u671f\u7c7b\u80a1\u53ea\u80fd\u6c38\u8fdc\u201c\u5468\u671f\u201d\u3002\u8fd9\u5c82\u4e0d\u662f\u8ba9\u4e2d\u592e\u4e00\u518d\u63d0\u5021\u7684\u4f20\u7edf\u4ea7\u4e1a\u201c\u8f6c\u578b\u5347\u7ea7\u201d\u3001\u201c\u8c03\u7ed3\u6784\uff0c\u8f6c\u65b9\u5f0f\u201d\u3001\u201c\u6df1\u5316\u56fd\u8d44\u56fd\u4f01\u6539\u9769\u201d\uff0c\u6210\u4e3a\u4e00\u53e5\u7a7a\u8bdd\uff1f<br>6\u3001\u9650\u5236\u6c11\u95f4\u8d44\u672c\u6765\u6295\u8d44\u3002\u89c4\u5b9a\u4e0a\u5e02\u516c\u53f8\u65b0\u8d2d\u4e70\u4f18\u8d28\u8d44\u4ea7\uff0c\u4e0d\u5f97\u8d85\u8fc7\u539f\u6709\u8d44\u4ea7\u7684100%\u3002\u54ea\u6015\u662f\u7528\u81ea\u6709\u8d44\u91d1\u8d2d\u4e70\uff0c\u4e5f\u4e0d\u5141\u8bb8\u3002\u8fd9\u7b49\u4e8e\u662f\u963b\u6b62\u6c11\u95f4\u8d44\u672c\u5728\u80a1\u5e02\u6295\u8d44\u7684\u79ef\u6781\u6027\u3002<br>7\u3001\u5c06\u518d\u878d\u8d44\u89c4\u6a21\u9650\u6b7b\u3002\u4e0d\u5206\u9752\u7ea2\u7682\u767d\u7684\u89c4\u5b9a\uff0c\u518d\u878d\u8d44\u4e0d\u5f97\u8d85\u8fc7\u80a1\u672c\u768420%\u3002\u8fd9\u7b49\u4e8e\u662f\u4e3a\u4e0a\u5e02\u516c\u53f8\u8fdb\u884c\u91cd\u5927\u8d44\u4ea7\u91cd\u7ec4\u8bbe\u7f6e\u4e00\u4e2a\u5927\u969c\u788d\u3002<br>8\u3001\u95ee\u8be2\u51fd\u8fc7\u4e8e\u9891\u7e41\u3001\u968f\u610f\u3002\u4ea4\u6613\u6240\u5bf9\u4f01\u4e1a\u8d44\u4ea7\u91cd\u7ec4\u6ca1\u5b8c\u6ca1\u4e86\u5730\u53d1\u95ee\u8be2\u51fd\uff0c\u5228\u6839\u7a76\u5e95\uff0c\u8ffd\u6eaf\u7ec6\u8282\uff0c\u903c\u4e0a\u5e02\u516c\u53f8\u6cc4\u9732\u540e\u7eed\u91cd\u7ec4\u52a8\u4f5c\u673a\u5bc6\uff0c\u4ee4\u8bb8\u591a\u4e0a\u5e02\u516c\u53f8\u54ed\u7b11\u4e0d\u5f97\u3002<br>9\u3001\u7528\u884c\u653f\u547d\u4ee4\u5e72\u6270\u4f01\u4e1a\u7ecf\u8425\u3002\u5982\uff0c\u5b64\u964b\u5be1\u95fb\u5730\u79f0\uff0c\u4e0a\u5e02\u516c\u53f810\u900130\u662f\u5168\u4e16\u754c\u6ca1\u6709\u7684\uff0c\u90fd\u8981\u53d7\u5230\u4e25\u5389\u76d1\u7ba1\uff0c\u5374\u88ab\u767e\u5ea610\u900190\u3001\u82f9\u679c10\u900160\u3001\u817e\u8baf10\u900140\u7684\u9ad8\u9001\u8f6c\u201c\u6253\u8138\u201d\uff0c\u8fdd\u53cd\u4e86\u516c\u53f8\u6cd5\u5173\u4e8e\u201c\u4f01\u4e1a\u6709\u81ea\u4e3b\u7684\u7ecf\u8425\u6743\u548c\u5206\u914d\u6743\u201d\u7684\u89c4\u5b9a\u3002<br>10\u3001\u7ba1\u6da8\u4e0d\u7ba1\u8dcc\u3002\u4e2a\u80a1\u6da820%\uff0c\u5c31\u53d1\u5f02\u5e38\u6ce2\u52a8\u516c\u544a\uff0c\u800c\u8dcc20%\uff0c\u5374\u89c6\u800c\u4e0d\u89c1\u3002\u751a\u81f3\u4ea4\u6613\u6240\u7684\u201c\u7a97\u53e3\u6307\u5bfc\u201d\u8fd8\u5177\u4f53\u5230\u67d0\u80a1\uff08\u5982\u5e7f\u5dde\u6e2f\uff09\u5468\u56db\u4e0d\u80fd\u6da8\u505c\uff0c\u800c\u5bf9\u5468\u4e94\u8dcc\u505c\uff0c\u5374\u4e00\u58f0\u4e0d\u542d\u3002<br>11\u3001\u6267\u6cd5\u4e0d\u516c\u3002\u5bf9\u591a\u6570\u5f02\u52a8\u80a1\uff0c3\u20144\u4e2a\u6da8\u505c\u5c31\u91c7\u53d6\u201c\u7279\u505c\u6838\u67e5\u201d\u7684\u63aa\u65bd\uff0c\u4f46\u5bf920\u591a\u53ea\u201c\u96c4\u5b89\u6982\u5ff5\u80a1\u201d\u8fde\u7eed5\u4e2a\u6da8\u505c\uff0c\u5374\u4e88\u4ee5\u9ed8\u8ba4\u3002\u76f4\u81f3\u7b2c\u516d\u4e2a\u6da8\u505c\uff0c\u6536\u76d8\u524d\u56fd\u5bb6\u961f\u51fa\u5b8c\u8d27\uff0c\u665a\u4e0a\u624d\u5ba3\u5e03\u7279\u505c\uff0c\u6709\u8fdd\u4e09\u516c\u539f\u5219", "news_id": "weibo", "id": 51, "timestamp": 42848}
{"content": "\u600e\u4e48\u4e0d\u7528\u8d1f\u5211\u4e8b\u8d23\u4efb\uff1f", "text": "\u600e\u4e48\u4e0d\u7528\u8d1f\u5211\u4e8b\u8d23\u4efb\uff1f", "news_id": "weibo", "id": 52, "timestamp": 42848}
{"content": "\u4e00\u500d\u4e5f\u662f\u5b9a\u683c\uff01\u8d5a\u4e86\u591a\u5c11\uff01\u6562\u8bf4\u5417\uff1f", "text": "\u4e00\u500d\u4e5f\u662f\u5b9a\u683c\uff01\u8d5a\u4e86\u591a\u5c11\uff01\u6562\u8bf4\u5417\uff1f", "news_id": "weibo", "id": 53, "timestamp": 42848}
{"content": "\u5341\u5927\u5168\u4e16\u754c\u90fd\u6ca1\u6709\uff1a 1.\u4e00\u5468\u53d110\u53ea\u65b0\u80a1\uff0c\u9000\u5e02\u80a1\u4e00\u5e74\u5374\u6ca1\u6709\u4e00\u4e2a\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>2.\u9762\u5bf9\u673a\u6784\u4e3e\u724c\uff0c\u4e0d\u53bb\u5236\u5b9a\u6cd5\u5f8b\u6cd5\u89c4\u89c4\u8303\u5f15\u5bfc\uff0c\u800c\u662f\u901a\u8fc7\u9a82\u5176\u662f\u201c\u5996\u7cbe\u201d\u201c\u5bb3\u4eba\u7cbe\u201d\u6765\u6050\u5413\u5413\u9000\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>3.\u9762\u5bf9\u4e0a\u5e02\u516c\u53f8\u9ad8\u9001\u8f6c\uff0c\u4e0d\u662f\u9760\u5236\u5b9a\u660e\u786e\u8be6\u7ec6\u7684\u89c4\u7ae0\u5236\u5ea6\u6765\u89c4\u8303\u754c\u5b9a\uff0c\u800c\u662f\u7528\u5634\u70ae\u201c\u5168\u4e16\u754c\u90fd\u6ca1\u6709\u201d\u5a01\u80c1\u6253\u51fb\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>4.\u660e\u660e\u662f\u6da8\u8dcc\u505c\u5236\u5ea6\uff0c\u8d44\u91d1\u91cf\u5927\u7684\u5c01\u5355\u4f1a\u88ab\u201c\u6307\u5bfc\u201d\u4e0d\u5f97\u5c01\u677f\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>5.\u7531\u4e8eT 1\u5236\u5ea6\uff0c\u9ad8\u4e70\u4f4e\u5356\u7684\u5272\u8089\u5927\u5355\u4e5f\u4f1a\u6536\u5230\u76d1\u7ba1\u51fd\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>6.\u968f\u610f\u7279\u505c\u76d1\u7ba1\uff0c\u6beb\u65e0\u6807\u51c6\uff0c\u5f53\u7136\uff0c\u505c\u724c\u53ea\u505c\u6da8\u505c\u80a1\uff0c\u8dcc\u505c\u4ece\u6765\u4e0d\u95ee\uff0c\u751f\u6015\u80a1\u7968\u6da8\u4e86\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>7.\u96c4\u5b89\u80a1\u7968\uff0c\u65e9\u4e0d\u505c\u665a\u4e0d\u505c\uff0c\u53ea\u7b49GJD\u51cf\u6301\u51fa\u8d27\u5b8c\u624d\u505c\u724c\uff0c\u800c\u4e14\u662f14\u4e2a\u4e00\u8d77\u505c\uff0c\u8fd9\u6837\u516c\u5f00\u516c\u5e73\u516c\u6b63\u7684\u4fdd\u62a4\u4e2d\u5c0f\u6295\u8d44\u8005\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>8.\u6bcf\u5f53\u80a1\u5e02\u76d8\u4e2d\u5927\u8dcc\uff0c\u5c3e\u76d8\u603b\u4f1a\u6709GJD\u62c9\u62ac\u4e0a\u8bc150\u7c7b\u6743\u91cd\u80a1\u4ee5\u7ef4\u62a4\u4e0a\u8bc1\u6307\u6570\u7684\u8138\u9762\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>9.\u6210\u6cc9\u8d44\u672c\u6210\u7acb\u4e0d\u52302\u5e74\uff0c\u65d7\u4e0b\u51716\u53ea\u57fa\u91d1\uff0c\u5728\u96c4\u5b89\u65b0\u533a\u516c\u5e03\u540e\u76848\u4e2a\u4ea4\u6613\u65e5\u51c0\u503c\u6da8\u5e45\u5168\u90e8\u8d85\u8fc750%\uff0c\u8fd9\u4e48\u725b\u7684\u79c1\u52df\u57fa\u91d1\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709\u3002\u5230\u5e95\u8c01\u662f\u5996\u602a\uff1f\u5230\u5e95\u8c01\u624d\u662f\u6700\u5927\u7684\u5bb3\u4eba\u7cbe\uff1f\uff1f", "text": "\u5341\u5927\u5168\u4e16\u754c\u90fd\u6ca1\u6709\uff1a 1.\u4e00\u5468\u53d110\u53ea\u65b0\u80a1\uff0c\u9000\u5e02\u80a1\u4e00\u5e74\u5374\u6ca1\u6709\u4e00\u4e2a\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>2.\u9762\u5bf9\u673a\u6784\u4e3e\u724c\uff0c\u4e0d\u53bb\u5236\u5b9a\u6cd5\u5f8b\u6cd5\u89c4\u89c4\u8303\u5f15\u5bfc\uff0c\u800c\u662f\u901a\u8fc7\u9a82\u5176\u662f\u201c\u5996\u7cbe\u201d\u201c\u5bb3\u4eba\u7cbe\u201d\u6765\u6050\u5413\u5413\u9000\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>3.\u9762\u5bf9\u4e0a\u5e02\u516c\u53f8\u9ad8\u9001\u8f6c\uff0c\u4e0d\u662f\u9760\u5236\u5b9a\u660e\u786e\u8be6\u7ec6\u7684\u89c4\u7ae0\u5236\u5ea6\u6765\u89c4\u8303\u754c\u5b9a\uff0c\u800c\u662f\u7528\u5634\u70ae\u201c\u5168\u4e16\u754c\u90fd\u6ca1\u6709\u201d\u5a01\u80c1\u6253\u51fb\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>4.\u660e\u660e\u662f\u6da8\u8dcc\u505c\u5236\u5ea6\uff0c\u8d44\u91d1\u91cf\u5927\u7684\u5c01\u5355\u4f1a\u88ab\u201c\u6307\u5bfc\u201d\u4e0d\u5f97\u5c01\u677f\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>5.\u7531\u4e8eT 1\u5236\u5ea6\uff0c\u9ad8\u4e70\u4f4e\u5356\u7684\u5272\u8089\u5927\u5355\u4e5f\u4f1a\u6536\u5230\u76d1\u7ba1\u51fd\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>6.\u968f\u610f\u7279\u505c\u76d1\u7ba1\uff0c\u6beb\u65e0\u6807\u51c6\uff0c\u5f53\u7136\uff0c\u505c\u724c\u53ea\u505c\u6da8\u505c\u80a1\uff0c\u8dcc\u505c\u4ece\u6765\u4e0d\u95ee\uff0c\u751f\u6015\u80a1\u7968\u6da8\u4e86\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>7.\u96c4\u5b89\u80a1\u7968\uff0c\u65e9\u4e0d\u505c\u665a\u4e0d\u505c\uff0c\u53ea\u7b49GJD\u51cf\u6301\u51fa\u8d27\u5b8c\u624d\u505c\u724c\uff0c\u800c\u4e14\u662f14\u4e2a\u4e00\u8d77\u505c\uff0c\u8fd9\u6837\u516c\u5f00\u516c\u5e73\u516c\u6b63\u7684\u4fdd\u62a4\u4e2d\u5c0f\u6295\u8d44\u8005\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>8.\u6bcf\u5f53\u80a1\u5e02\u76d8\u4e2d\u5927\u8dcc\uff0c\u5c3e\u76d8\u603b\u4f1a\u6709GJD\u62c9\u62ac\u4e0a\u8bc150\u7c7b\u6743\u91cd\u80a1\u4ee5\u7ef4\u62a4\u4e0a\u8bc1\u6307\u6570\u7684\u8138\u9762\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709<br>9.\u6210\u6cc9\u8d44\u672c\u6210\u7acb\u4e0d\u52302\u5e74\uff0c\u65d7\u4e0b\u51716\u53ea\u57fa\u91d1\uff0c\u5728\u96c4\u5b89\u65b0\u533a\u516c\u5e03\u540e\u76848\u4e2a\u4ea4\u6613\u65e5\u51c0\u503c\u6da8\u5e45\u5168\u90e8\u8d85\u8fc750%\uff0c\u8fd9\u4e48\u725b\u7684\u79c1\u52df\u57fa\u91d1\uff0c\u5168\u4e16\u754c\u90fd\u6ca1\u6709\u3002\u5230\u5e95\u8c01\u662f\u5996\u602a\uff1f\u5230\u5e95\u8c01\u624d\u662f\u6700\u5927\u7684\u5bb3\u4eba\u7cbe\uff1f\uff1f", "news_id": "weibo", "id": 54, "timestamp": 42848}
