{"content": "\u6709\u6cd5\u4e0d\u4f9d\u3001\u6709\u89c4\u4e0d\u5faa\u3001\u6709\u8fdd\u4e0d\u5bdf\uff0c\u8fd9\u662f\u6211\u4eec\u597d\u591a\u5236\u5ea6\u7a7a\u8f6c\u7684\u6839\u672c\u95ee\u9898\u3002\u4f60\u8bf4\u6211\u4eec\u6ca1\u6709\u5236\u5ea6\u5417\uff1f\u6709\uff0c\u5c31\u662f\u4e0d\u6309\u5236\u5ea6\u529e\u3002\u6709\u7684\u751a\u5230\u641e\u5236\u5ea6\u4ee5\u5916\u7684\u4e1c\u897f\uff0c\u4f60\u8bf4\u6559\u80b2\u4e0d\u51c6\u4e71\u6536\u8d39\uff0c\u54b1\u6765\u4e2a\u4f53\u5236\u5916\u6559\u80b2\uff1b\u4f60\u8bf4\u6cbb\u6c61\uff0c\u6211\u6765\u4e2a\u4ea7\u4e1a\u8f6c\u79fb\uff0c\u632a\u4e2a\u5730\u65b9\u3002\u505a\u4e8b\u4e00\u5b9a\u8981\u8001\u5b9e\u3001\u771f\u5b9e\u3001\u8bda\u5b9e\uff0c\u6211\u4eec\u7684\u5404\u9879\u4e8b\u4e1a\u624d\u80fd\u6309\u7167\u79d1\u5b66\u7684\u3001\u4e25\u8c28\u7684\u3001\u89c4\u5219\u7684\u79e9\u5e8f\u5411\u524d\u53d1\u5c55\u3002", "text": "\u6709\u6cd5\u4e0d\u4f9d\u3001\u6709\u89c4\u4e0d\u5faa\u3001\u6709\u8fdd\u4e0d\u5bdf\uff0c\u8fd9\u662f\u6211\u4eec\u597d\u591a\u5236\u5ea6\u7a7a\u8f6c\u7684\u6839\u672c\u95ee\u9898\u3002\u4f60\u8bf4\u6211\u4eec\u6ca1\u6709\u5236\u5ea6\u5417\uff1f\u6709\uff0c\u5c31\u662f\u4e0d\u6309\u5236\u5ea6\u529e\u3002\u6709\u7684\u751a\u5230\u641e\u5236\u5ea6\u4ee5\u5916\u7684\u4e1c\u897f\uff0c\u4f60\u8bf4\u6559\u80b2\u4e0d\u51c6\u4e71\u6536\u8d39\uff0c\u54b1\u6765\u4e2a\u4f53\u5236\u5916\u6559\u80b2\uff1b\u4f60\u8bf4\u6cbb\u6c61\uff0c\u6211\u6765\u4e2a\u4ea7\u4e1a\u8f6c\u79fb\uff0c\u632a\u4e2a\u5730\u65b9\u3002\u505a\u4e8b\u4e00\u5b9a\u8981\u8001\u5b9e\u3001\u771f\u5b9e\u3001\u8bda\u5b9e\uff0c\u6211\u4eec\u7684\u5404\u9879\u4e8b\u4e1a\u624d\u80fd\u6309\u7167\u79d1\u5b66\u7684\u3001\u4e25\u8c28\u7684\u3001\u89c4\u5219\u7684\u79e9\u5e8f\u5411\u524d\u53d1\u5c55\u3002", "news_id": "weibo", "id": 260, "timestamp": 42847}
