{"content": "(\u65b0\u80a1\u5168\u90e8\u7f51\u4e0a\u914d\u552e\uff0c\u4e2d\u7b7e1\u7801\u8d2d1\u80a1\uff0c\u63d0\u9ad8\u767e\u500d\u4ee5\u4e0a\u4e2d\u7b7e\u7387\uff0c\u904f\u5236\u66b4\u7092\uff09\u5f53\u52a1\u4e4b\u6025\u51cf\u6301\u548c\u518d\u878d\u8d44\u8981\u6302\u94a9\u4e1a\u7ee9\u5206\u7ea2\uff0c\u8fdd\u5219\u91cd\u7f5a\uff0c\u4fc3\u8fdb\u957f\u671f\u826f\u597d\u7ecf\u8425\uff0c\u7f13\u89e3\u4e0a\u5e02\u5708\u94b1\u5957\u73b0\u538b\u529b\uff08\u5c3d\u5feb\u5f00\u5f81\u80a1\u6307\u671f\u8d27\u7684\u5370\u82b1\u7a0e\uff0c\u624d\u80fd\u964d\u4f4e\u6760\u6746\u53ca\u9ad8\u9891\u98ce\u9669\uff0c\u9650\u5236\u5176\u4e71\u5f71\u54cd\u80a1\u5e02\uff09\u57fa\u91d1\u53ea\u6709\u76c8\u5229\u624d\u6536\u7ba1\u7406\u8d39\uff0c\u771f\u6b63\u4e3a\u6295\u8d44\u8005\u670d\u52a1\uff0c\u8fde\u7eed3\u5929\u6da8\u8dcc\u505c\u5c31\u505c\u724c1\u661f\u671f\u4ee5\u4e0a\uff0c\u5171\u540c\u53d7\u76ca\uff0c\u5229\u56fd\u5229\u6c11\uff01", "text": "(\u65b0\u80a1\u5168\u90e8\u7f51\u4e0a\u914d\u552e\uff0c\u4e2d\u7b7e1\u7801\u8d2d1\u80a1\uff0c\u63d0\u9ad8\u767e\u500d\u4ee5\u4e0a\u4e2d\u7b7e\u7387\uff0c\u904f\u5236\u66b4\u7092\uff09\u5f53\u52a1\u4e4b\u6025\u51cf\u6301\u548c\u518d\u878d\u8d44\u8981\u6302\u94a9\u4e1a\u7ee9\u5206\u7ea2\uff0c\u8fdd\u5219\u91cd\u7f5a\uff0c\u4fc3\u8fdb\u957f\u671f\u826f\u597d\u7ecf\u8425\uff0c\u7f13\u89e3\u4e0a\u5e02\u5708\u94b1\u5957\u73b0\u538b\u529b\uff08\u5c3d\u5feb\u5f00\u5f81\u80a1\u6307\u671f\u8d27\u7684\u5370\u82b1\u7a0e\uff0c\u624d\u80fd\u964d\u4f4e\u6760\u6746\u53ca\u9ad8\u9891\u98ce\u9669\uff0c\u9650\u5236\u5176\u4e71\u5f71\u54cd\u80a1\u5e02\uff09\u57fa\u91d1\u53ea\u6709\u76c8\u5229\u624d\u6536\u7ba1\u7406\u8d39\uff0c\u771f\u6b63\u4e3a\u6295\u8d44\u8005\u670d\u52a1\uff0c\u8fde\u7eed3\u5929\u6da8\u8dcc\u505c\u5c31\u505c\u724c1\u661f\u671f\u4ee5\u4e0a\uff0c\u5171\u540c\u53d7\u76ca\uff0c\u5229\u56fd\u5229\u6c11\uff01", "news_id": "weibo", "id": 356, "timestamp": 42847}
{"content": "\u771f\u6b63\u7684\u80a1\u795e\uff0c\u5f90\u7fd4\u5f90\u8001\u5927\u90fd\u8981\u7f9e\u6127\u6b7b   ", "text": "\u771f\u6b63\u7684\u80a1\u795e\uff0c\u5f90\u7fd4\u5f90\u8001\u5927\u90fd\u8981\u7f9e\u6127\u6b7b   ", "news_id": "weibo", "id": 357, "timestamp": 42847}
{"content": "\u201c\u5b89\u7136\u96c6\u56e2\u201d\uff0c\u662f\u7f8e\u56fd\u7684\u4e16\u754c\u6700\u5927\u7684\u7efc\u5408\u80fd\u6e90\u516c\u53f8\uff0c\u5b83\u7684\u9ad8\u7ba1\u6770\u5f17\u91cc.\u65af\u57fa\u6797\uff0c\u4ec5\u4ec5\u662f\u56e0\u4e3a\u4e09\u5e74\u65f6\u95f4\u3001\u603b\u5171\u505a\u4e866\u4ebf\u7f8e\u5143\u7684\u865a\u76c8\u5047\u8d26\uff08\u5176\u5e74\u8425\u4e1a\u989d\u5728\u6570\u767e\u4ebf\u7f8e\u5143\u4e4b\u4e0a\uff09\uff0c\u4ed6\u4fbf\u88ab\u7f8e\u56fd\u8054\u90a6\u6cd5\u9662\uff0c\u6709\u7f6a\u5b9a\u8c33\uff0c\u5224\u521124\u5e74\u96f64\u4e2a\u6708\u7684\u76d1\u7981\u2014\u2014\u800c\u4e2d\u56fd\u7adf\u7136\u5bf9\u51af\u5c0f\u6811\u7f5a\u6b3e\u4ec5\u4ec5\u662f1\u500d\uff08\u9876\u683c\u662f5\u500d\uff09\uff0c\u672a\u79fb\u4ea4\u53f8\u6cd5\uff0c\u663e\u7136\u662f\u504f\u8f7b\u4e86\u5f88\u591a\u3002\u4ed6\u6bd4\u674e\u542f\u7ea2\u7684\u6076\u52a3\u5f71\u54cd\uff0c\u5927\u4e07\u500d\uff0c\u56e0\u4e3a\u4ed6\u8eab\u5728\u76d1\u7ba1\u5c42\uff0c\u6267\u6cd5\u72af\u6cd5\u3002\u5de8\u9e7f\u53bf\u533b\u9662\u8d75\u5fd7\u9a9e\u8457\u7684\u300a\u7ea2\u978b\u4e3a\u541b\u821e\u300b\u5c31\u8c08\u5230\u4e86\u6ca1\u6709\u5f3a\u5065\u7684\u80a1\u5e02\uff0c\u5c31\u4e0d\u4f1a\u6709\u4efb\u4f55\u5f3a\u5927\u7684\u73b0\u4ee3\u56fd\u5bb6\uff0c\u66f4\u522b\u8bf4\u8d85\u7ea7\u5927\u56fd\u4e86\uff01\u8fd9\u662f\u7ed3\u6784\u6027\u5148\u8fdb\u4e0e\u5426\u2014\u2014\u8fd9\u662f\u73b0\u4ee3\u7ecf\u6d4e\u7684\u94c1\u94c1\u7684\u89c4\u5f8b\uff0c\u6211\u4eec\u53ea\u80fd\u5229\u7528\u89c4\u5f8b\uff0c\u800c\u4e0d\u80fd\u552f\u5fc3\u4e3b\u4e49\u5148\u9a8c\u8bba\uff0c\u53bb\u4e3b\u89c2\u8131\u79bb\u89c4\u5f8b\uff0c\u53bb\u521b\u9020\u5176\u5b83\u89c4\u5f8b\u3002\u4e2d\u56fd\u5018\u82e5\u79bb\u5f00\u80a1\u5e02\u8fd9\u4e2a\u4f01\u4e1a\u552f\u4e00\u7684\u76f4\u63a5\u878d\u8d44\u7684\u6e20\u9053\uff0c\u90a3\u6837\u975e\u4f46\u4e0d\u80fd\u5efa\u8bbe\u6210\u5f3a\u56fd\uff0c\u5374\u80fd\u9020\u6210\u7ecf\u6d4e\u7834\u4ea7\u5927\u8427\u6761\u548c\u653f\u6cbb\u5371\u673a\u3002\u80a1\u5e02\u4e0e\u4f01\u4e1a\uff0c\u8fd9\u662f\u76f4\u63a5\u7684\u9c7c\u6c34\u5173\u7cfb\u3002\u8bf7\u95ee\uff0c\u82e5\u8fde\u8fd9\u4e2a\u7ecf\u6d4e\u5b66ABC\u90fd\u4e0d\u61c2\u7684\u8bdd\uff0c\u51ed\u5565\u572813\u4ebf\u4eba\u6c11\u9762\u524d\u6307\u624b\u753b\u811a\u5462\uff1f", "text": "\u201c\u5b89\u7136\u96c6\u56e2\u201d\uff0c\u662f\u7f8e\u56fd\u7684\u4e16\u754c\u6700\u5927\u7684\u7efc\u5408\u80fd\u6e90\u516c\u53f8\uff0c\u5b83\u7684\u9ad8\u7ba1\u6770\u5f17\u91cc.\u65af\u57fa\u6797\uff0c\u4ec5\u4ec5\u662f\u56e0\u4e3a\u4e09\u5e74\u65f6\u95f4\u3001\u603b\u5171\u505a\u4e866\u4ebf\u7f8e\u5143\u7684\u865a\u76c8\u5047\u8d26\uff08\u5176\u5e74\u8425\u4e1a\u989d\u5728\u6570\u767e\u4ebf\u7f8e\u5143\u4e4b\u4e0a\uff09\uff0c\u4ed6\u4fbf\u88ab\u7f8e\u56fd\u8054\u90a6\u6cd5\u9662\uff0c\u6709\u7f6a\u5b9a\u8c33\uff0c\u5224\u521124\u5e74\u96f64\u4e2a\u6708\u7684\u76d1\u7981\u2014\u2014\u800c\u4e2d\u56fd\u7adf\u7136\u5bf9\u51af\u5c0f\u6811\u7f5a\u6b3e\u4ec5\u4ec5\u662f1\u500d\uff08\u9876\u683c\u662f5\u500d\uff09\uff0c\u672a\u79fb\u4ea4\u53f8\u6cd5\uff0c\u663e\u7136\u662f\u504f\u8f7b\u4e86\u5f88\u591a\u3002\u4ed6\u6bd4\u674e\u542f\u7ea2\u7684\u6076\u52a3\u5f71\u54cd\uff0c\u5927\u4e07\u500d\uff0c\u56e0\u4e3a\u4ed6\u8eab\u5728\u76d1\u7ba1\u5c42\uff0c\u6267\u6cd5\u72af\u6cd5\u3002\u5de8\u9e7f\u53bf\u533b\u9662\u8d75\u5fd7\u9a9e\u8457\u7684\u300a\u7ea2\u978b\u4e3a\u541b\u821e\u300b\u5c31\u8c08\u5230\u4e86\u6ca1\u6709\u5f3a\u5065\u7684\u80a1\u5e02\uff0c\u5c31\u4e0d\u4f1a\u6709\u4efb\u4f55\u5f3a\u5927\u7684\u73b0\u4ee3\u56fd\u5bb6\uff0c\u66f4\u522b\u8bf4\u8d85\u7ea7\u5927\u56fd\u4e86\uff01\u8fd9\u662f\u7ed3\u6784\u6027\u5148\u8fdb\u4e0e\u5426\u2014\u2014\u8fd9\u662f\u73b0\u4ee3\u7ecf\u6d4e\u7684\u94c1\u94c1\u7684\u89c4\u5f8b\uff0c\u6211\u4eec\u53ea\u80fd\u5229\u7528\u89c4\u5f8b\uff0c\u800c\u4e0d\u80fd\u552f\u5fc3\u4e3b\u4e49\u5148\u9a8c\u8bba\uff0c\u53bb\u4e3b\u89c2\u8131\u79bb\u89c4\u5f8b\uff0c\u53bb\u521b\u9020\u5176\u5b83\u89c4\u5f8b\u3002\u4e2d\u56fd\u5018\u82e5\u79bb\u5f00\u80a1\u5e02\u8fd9\u4e2a\u4f01\u4e1a\u552f\u4e00\u7684\u76f4\u63a5\u878d\u8d44\u7684\u6e20\u9053\uff0c\u90a3\u6837\u975e\u4f46\u4e0d\u80fd\u5efa\u8bbe\u6210\u5f3a\u56fd\uff0c\u5374\u80fd\u9020\u6210\u7ecf\u6d4e\u7834\u4ea7\u5927\u8427\u6761\u548c\u653f\u6cbb\u5371\u673a\u3002\u80a1\u5e02\u4e0e\u4f01\u4e1a\uff0c\u8fd9\u662f\u76f4\u63a5\u7684\u9c7c\u6c34\u5173\u7cfb\u3002\u8bf7\u95ee\uff0c\u82e5\u8fde\u8fd9\u4e2a\u7ecf\u6d4e\u5b66ABC\u90fd\u4e0d\u61c2\u7684\u8bdd\uff0c\u51ed\u5565\u572813\u4ebf\u4eba\u6c11\u9762\u524d\u6307\u624b\u753b\u811a\u5462\uff1f", "news_id": "weibo", "id": 358, "timestamp": 42847}
