{"content": "\u300a\u5211\u6cd5\u300b\u7b2c\u4e00\u767e\u516d\u5341\u6761\u3000\u3010\u6b3a\u8bc8\u53d1\u884c\u80a1\u7968\u3001\u503a\u5238\u7f6a\u3011\u548c\u7b2c\u4e00\u767e\u516d\u5341\u4e00\u6761\u3000\u3010\u8fdd\u89c4\u62ab\u9732\u3001\u4e0d\u62ab\u9732\u91cd\u8981\u4fe1\u606f\u7f6a\u3011\uff0c\u5df2\u884c\u653f\u5904\u7f5a\u8ba4\u5b9a\u6b3a\u8bc8\u53d1\u884c\u7684\u201c\u6b23\u6cf0\u7535\u6c14\u201d\u7b49\u81f3\u4eca\u6ca1\u6709\u79fb\u9001\u53f8\u6cd5\u673a\u5173\u8ffd\u7a76\u5211\u4e8b\u8d23\u4efb\u80fd\u7ed9\u4e2a\u89e3\u91ca\u5417\uff1f\u5e02\u573a\u9700\u8981\u76d1\u7ba1\u4ec0\u4e48\uff1f\u600e\u4e48\u6837\u76d1\u7ba1\uff1f\u4ee5\u8a00\u4ee3\u6cd5\uff0c\u4ee5\u7f5a\u4ee3\u6cd5\uff0c\u4ee5\u81f4\u4e71\u8c61\u9891\u53d1\u3002\u8fd9\u4e00\u5e74\u591a\u6765\u76d1\u7ba1\u5c42\u53ea\u7ba1\u6da8\u4e0d\u7ba1\u8dcc\uff0c\u6da8\u505c\u7684\u80a1\u8981\u505c\u724c\u81ea\u67e5\uff0c\u8dcc\u505c\u4e86\u7684\u4e3a\u5565\u4e0d\u67e5\uff1f\u5c24\u5176\u662f15\u5e74\u80a1\u707e\u65f6\u5927\u8086\u6076\u610f\u6cbd\u7a7a\u7684\u4e3a\u5565\u4e0d\u67e5\uff1f\u8fd1\u6bb5\u65f6\u95f4\u77ed\u671f\u5185\u8dcc\u4e86\u767e\u5206\u4e4b\u4e09\u56db\u5341\u7684\u4e3a\u5565\u4e0d\u67e5\uff1f\u96be\u9053\u76d1\u7ba1\u5c31\u8fd9\u4e48\u4efb\u6027\u800c\u4e0d\u9700\u8981\u516c\u5e73\uff1f\u5bf9\u8fd9\u7b49\u4e71\u8c61\u5982\u4e0d\u8ffd\u7a76\u5211\u4e8b\u8d23\u4efb\u5c06\u4f1a\u957f\u671f\u7684\u5c42\u51fa\u4e0d\u7a77\u3002", "text": "\u300a\u5211\u6cd5\u300b\u7b2c\u4e00\u767e\u516d\u5341\u6761\u3000\u3010\u6b3a\u8bc8\u53d1\u884c\u80a1\u7968\u3001\u503a\u5238\u7f6a\u3011\u548c\u7b2c\u4e00\u767e\u516d\u5341\u4e00\u6761\u3000\u3010\u8fdd\u89c4\u62ab\u9732\u3001\u4e0d\u62ab\u9732\u91cd\u8981\u4fe1\u606f\u7f6a\u3011\uff0c\u5df2\u884c\u653f\u5904\u7f5a\u8ba4\u5b9a\u6b3a\u8bc8\u53d1\u884c\u7684\u201c\u6b23\u6cf0\u7535\u6c14\u201d\u7b49\u81f3\u4eca\u6ca1\u6709\u79fb\u9001\u53f8\u6cd5\u673a\u5173\u8ffd\u7a76\u5211\u4e8b\u8d23\u4efb\u80fd\u7ed9\u4e2a\u89e3\u91ca\u5417\uff1f\u5e02\u573a\u9700\u898