{"content": "\u56de\u590d@\u677f\u677f\u677f\u8d77\u6765:\u6211\u662f\u60f3\u770b\u9ad8\u7389\u826f\u4e66\u8bb0\u4e3a\u4e86\u4fdd\u4f4f\u81ea\u5df1\u7684\u6743\u5229\uff0c\u8ddf\u8d22\u5bcc\uff0c\u60c5\u4eba\u3002\u600e\u4e48\u9677\u5bb3\u81ea\u5df1\u7684\u5b66\u751f\u7684\uff1f[\u9177][\u9177][\u9177][\u9177]\u6bcf\u5929\u90fd\u7b49\u7740\u66f4\u65b0\uff0c\u5e73\u65f6\u4e0d\u770b\u7535\u89c6\u5267\u7684\u4eba\uff0c\u6ca1\u60f3\u5230\u3002\u4e3a\u4e86\u8fd9\u90e8\u5267\u4e5f\u662f\u62fc\u4e86\u3002", "text": "\u56de\u590d@\u677f\u677f\u677f\u8d77\u6765:\u6211\u662f\u60f3\u770b\u9ad8\u7389\u826f\u4e66\u8bb0\u4e3a\u4e86\u4fdd\u4f4f\u81ea\u5df1\u7684\u6743\u5229\uff0c\u8ddf\u8d22\u5bcc\uff0c\u60c5\u4eba\u3002\u600e\u4e48\u9677\u5bb3\u81ea\u5df1\u7684\u5b66\u751f\u7684\uff1f[\u9177][\u9177][\u9177][\u9177]\u6bcf\u5929\u90fd\u7b49\u7740\u66f4\u65b0\uff0c\u5e73\u65f6\u4e0d\u770b\u7535\u89c6\u5267\u7684\u4eba\uff0c\u6ca1\u60f3\u5230\u3002\u4e3a\u4e86\u8fd9\u90e8\u5267\u4e5f\u662f\u62fc\u4e86\u3002", "news_id": "weibo", "id": 1609, "timestamp": 42848}
