{"content": "\u6ca1\u6709\u4e25\u5211\u6cd5\u5f8b\u63a7\u5236\u9020\u5047\u4e0a\u5e02.\u52a0\u901f\u53d1\u884c\u65b0\u80a1\u7b49\u540c\u72af\u7f6a.\u51af\u5c0f\u6811\u7684\u7684\u51fa\u73b0.\u96be\u9053\u4e0d\u662f\u4f60\u4eec\u7ba1\u7406\u5c42\u6539\u6b63\u9519\u8bef\u7684\u65f6\u5019\u5417?\u5783\u573e\u80a1\u662f\u4f60\u4eec\u6279\u51fa\u6765\u7684\u800c\u4e0d\u80a1\u6c11\u4e70\u51fa\u6765\u7684.\u6765\u4e00\u4e2a\u9020\u5047\u4e0a\u5e02\u5224\u7ec8\u8eab\u76d1\u7981.600\u591a\u65b0\u80a1\u6392\u961f\u4e0a\u5e02\u4f1a\u5c11\u516b\u4e5d\u6210\u4e86\u8bd5\u8bd5\u770b\u50b2\u6162\u7684\u7ba1\u7406\u5c42.", "text": "\u6ca1\u6709\u4e25\u5211\u6cd5\u5f8b\u63a7\u5236\u9020\u5047\u4e0a\u5e02.\u52a0\u901f\u53d1\u884c\u65b0\u80a1\u7b49\u540c\u72af\u7f6a.\u51af\u5c0f\u6811\u7684\u7684\u51fa\u73b0.\u96be\u9053\u4e0d\u662f\u4f60\u4eec\u7ba1\u7406\u5c42\u6539\u6b63\u9519\u8bef\u7684\u65f6\u5019\u5417?\u5783\u573e\u80a1\u662f\u4f60\u4eec\u6279\u51fa\u6765\u7684\u800c\u4e0d\u80a1\u6c11\u4e70\u51fa\u6765\u7684.\u6765\u4e00\u4e2a\u9020\u5047\u4e0a\u5e02\u5224\u7ec8\u8eab\u76d1\u7981.600\u591a\u65b0\u80a1\u6392\u961f\u4e0a\u5e02\u4f1a\u5c11\u516b\u4e5d\u6210\u4e86\u8bd5\u8bd5\u770b\u50b2\u6162\u7684\u7ba1\u7406\u5c42.", "news_id": "weibo", "id": 2743, "timestamp": 42848}
