{"content": "[/\u53d1\u6012]\u81ea\u4ece\u5f00\u653e\u6539\u9769\u540e\uff0c\u600e\u5730\u5c31\u662f\u8d8a\u6765\u8d8a\u662f\u8d70\u5411\u65e7\u793e\u4f1a\uff1f\uff1f\u6b3a\u9a97\uff0c\u8bc8\u9a97\uff0c\u5404\u79cd\u4e0d\u660e\u767d\u7684\u8bbe\u7f6e\u90fd\u5728\u4e0d\u65ad\u4ea7\u751f\uff1f\u5c31\u662f\u533b\u9662\u4e5f\u662f\u660e\u662f\u53ef\u4ee5\u6cbb\u597d\u7684\u75c5\uff0c\u4e0d\u660e\u767d\u7684\u60a3\u8005\u4e5f\u603b\u662f\u88ab\u9a97\u6765\u9a97\u53bb\u7684\uff0c\u5c31\u662f\u4f4f\u8fdb\u4e86\u533b\u9662\u4e5f\u662f\uff01\uff01\u7b2c\u4e00\u662f\u8bbe\u7f6e\u4e86\u7816\u5bb6\u95e8\u8bca\uff0c\u4e00\u6b21\u6302\u53f7\u51e0\u767e\u5143\uff0c\u7f51\u4e0a\u6307\u8be2\u533b\u9662\u7816\u5bb6\u4e5f\u662f\u5341\u5206\u949f\u4e8c\u767e\u5143\uff0c\u641e\u4e0d\u5bf9\u79d1\u76ee\u5c31\u662f\u767d\u82b1\u65f6\u95f4\u53c8\u4e22\u94b1\u4e86\uff01\uff01\u7b2c\u4e8c\u662f\u533b\u751f\u559c\u6b22\u8ba9\u4f60\u4f4f\u9662\u65f6\u95f4\u8d8a\u957f\u8d8a\u597d\uff0c\u751a\u81f3\u5efa\u8bae\u4f60\u624b\u672f\uff0c\u641e\u4e0d\u597d\u5c31\u662f\u762b\u75ea\uff1b\u7b2c\u4e09\u5c31\u662f\u597d\u533b\u751f\u4e0d\u591a\uff0c\u5f88\u96be\u627e\u5230\u3002\u7b2c\u56db\u5c31\u662f\u4e5f\u6709\u9a97\u4f60\u94b1\u7684\u533b\u751f\uff0c\u7b2c\u4e94\u533b\u836f\u5e7f\u544a\u57fa\u672c\u4e0a\u5168\u90e8\u662f\u5728\u9a97\u4eba\u94b1\u8d22\uff0c\u5c24\u5176\u662f\u4fdd\u5065\u836f\u6750\uff1b\u4e2d\u8349\u836f\u7684\u53ef\u4ee5\u6cbb\u75c5\u7684\u8bf4\u660e\u592a\u5938\u5f20\uff0c\u6ca1\u6cd5\u5b50\u77e5\u9053\u6709\u7528\u6ca1\u6709\u7528\uff1b\u5c31\u662f\u7535\u89c6\u53f0\u7684\u517b\u751f\u8282\u76ee\u4e5f\u662f\u5728\u9a97\u4eba\u7684\uff01\uff01\uff01[/\u53d1\u6012]", "text": "[/\u53d1\u6012]\u81ea\u4ece\u5f00\u653e\u6539\u9769\u540e\uff0c\u600e\u5730\u5c31\u662f\u8d8a\u6765\u8d8a\u662f\u8d70\u5411\u65e7\u793e\u4f1a\uff1f\uff1f\u6b3a\u9a97\uff0c\u8bc8\u9a97\uff0c\u5404\u79cd\u4e0d\u660e\u767d\u7684\u8bbe\u7f6e\u90fd\u5728\u4e0d\u65ad\u4ea7\u751f\uff1f\u5c31\u662f\u533b\u9662\u4e5f\u662f\u660e\u662f\u53ef\u4ee5\u6cbb\u597d\u7684\u75c5\uff0c\u4e0d\u660e\u767d\u7684\u60a3\u8005\u4e5f\u603b\u662f\u88ab\u9a97\u6765\u9a97\u53bb\u7684\uff0c\u5c31\u662f\u4f4f\u8fdb\u4e86\u533b\u9662\u4e5f\u662f\uff01\uff01\u7b2c\u4e00\u662f\u8bbe\u7f6e\u4e86\u7816\u5bb6\u95e8\u8bca\uff0c\u4e00\u6b21\u6302\u53f7\u51e0\u767e\u5143\uff0c\u7f51\u4e0a\u6307\u8be2\u533b\u9662\u7816\u5bb6\u4e5f\u662f\u5341\u5206\u949f\u4e8c\u767e\u5143\uff0c\u641e\u4e0d\u5bf9\u79d1\u76ee\u5c31\u662f\u767d\u82b1\u65f6\u95f4\u53c8\u4e22\u94b1\u4e86\uff01\uff01\u7b2c\u4e8c\u662f\u533b\u751f\u559c\u6b22\u8ba9\u4f60\u4f4f\u9662\u65f6\u95f4\u8d8a\u957f\u8d8a\u597d\uff0c\u751a\u81f3\u5efa\u8bae\u4f60\u624b\u672f\uff0c\u641e\u4e0d\u597d\u5c31\u662f\u762b\u75ea\uff1b\u7b2c\u4e09\u5c31\u662f\u597d\u533b\u751f\u4e0d\u591a\uff0c\u5f88\u96be\u627e\u5230\u3002\u7b2c\u56db\u5c31\u662f\u4e5f\u6709\u9a97\u4f60\u94b1\u7684\u533b\u751f\uff0c\u7b2c\u4e94\u533b\u836f\u5e7f\u544a\u57fa\u672c\u4e0a\u5168\u90e8\u662f\u5728\u9a97\u4eba\u94b1\u8d22\uff0c\u5c24\u5176\u662f\u4fdd\u5065\u836f\u6750\uff1b\u4e2d\u8349\u836f\u7684\u53ef\u4ee5\u6cbb\u75c5\u7684\u8bf4\u660e\u592a\u5938\u5f20\uff0c\u6ca1\u6cd5\u5b50\u77e5\u9053\u6709\u7528\u6ca1\u6709\u7528\uff1b\u5c31\u662f\u7535\u89c6\u53f0\u7684\u517b\u751f\u8282\u76ee\u4e5f\u662f\u5728\u9a97\u4eba\u7684\uff01\uff01\uff01[/\u53d1\u6012]", "news_id": "weibo", "id": 3247, "timestamp": 42847}
