{"content": "\u4ef7\u503c\u6295\u8d44\u8fd8\u662f\u4ef7\u503c\u6295\u673a\uff1f420\u5143\u7684\u8d35\u5dde\u8305\u53f0\uff0c69.19\u5143\u7684\u4e1c\u963f\u963f\u80f6\uff0c91.63\u5143\u7684\u4e91\u5357\u767d\u836f\uff0c34.18\u5143\u7684\u683c\u529b\u7535\u5668\uff0c58.6\u5143\u7684\u7247\u4ed4\u7640\u53ca46.4\u5143\u7684\u5c0f\u5929\u9e45<br><br>\uff0c\u88ab\u4e3b\u6d41\u8d44\u91d1\u8ffd\u6367\u800c\u5c61\u521b\u65b0\u9ad8\u3002\u96be\u9053\u4e2d\u56fd\u80a1\u5e02\u552f\u6709\u559d\u9152\u5403\u836f\u7684\u4e2a\u80a1\u5c5e\u4e8e\u4ef7\u503c\u6295\u8d44\u6807\u7684\uff1f\u90a3\u4e48\u4e2d\u56fd\u7684\u5236\u9020\u4e1a\u53d1\u5c55\u5728\u54ea\u91cc\uff1f\u4e2d\u56fd\u7684\u65b0\u5174\u4ea7\u4e1a\u5728\u54ea\u91cc\uff1f\u4e2d<br><br>\u56fd\u7684\u79d1\u6280\u9886\u5148\u5728\u54ea\u91cc\uff1f\u4e2d\u56fd\u7684\u4e92\u8054\u7f51\u3001\u667a\u80fd\u673a\u5668\u4eba\u5728\u54ea\u91cc\uff1f\u65b0\u5174\u4ea7\u4e1a\u7684\u9ad8\u4f30\u503c\u5c31\u4e0d\u5177\u5408\u7406\u6027\uff1f\u53d7\u5404\u79cd\u653f\u7b56\u6276\u6301\u53ca\u7ecf\u6d4e\u53d1\u5c55\u800c\u4ea7\u751f\u7684\u6982\u5ff5\u3001\u70ed\u70b9\u3001\u9898<br><br>\u6750\uff0c\u5728\u80a1\u5e02\u4e2d\u7684\u53cd\u6620\u5c31\u5168\u662f\u6295\u673a\u56e0\u7d20\uff1f\u5c31\u6ca1\u6709\u6295\u8d44\u7684\u6210\u4efd\uff1f\u80a1\u5e02\u662f\u7092\u672a\u6765\u7684\uff0c\u4e0d\u662f\u7092\u6628\u5929\u548c\u4eca\u5929\u7684\u3002\u5982\u679c\u5747\u6309\u5e02\u76c8\u7387\u3001\u5e02\u51c0\u7387\u5206\u6790\uff0c\u800c\u9760\u4f01\u4e1a\u5206\u7ea2<br><br>\u56de\u62a5\u5747\u8c08\u4e0d\u4e0a\u6295\u8d44\u4ef7\u503c\uff1f\u4e00\u4e2a\u4e0a\u5e02\u516c\u53f8\u7684\u4ef7\u503c\u4e0d\u4ec5\u6709\u4f01\u4e1a\u5c5e\u6027\u7684\u56e0\u7d20\uff0c\u4e5f\u6709\u5e02\u573a\u5c5e\u6027\u7684\u56e0\u7d20\u3002\u652f\u6301\u4f01\u4e1a\u53d1\u884c\u4e0a\u5e02\uff0c\u4e0d\u4ec5\u4ec5\u662fIPO\u5ba1\u6279\u4e86\u4e8b\uff0c\u8fd8\u9700\u8981<br><br>\u8ba9\u5176\u5728\u4e8c\u7ea7\u5e02\u573a\u4e0a\u53d1\u6325\u518d\u878d\u8d44\u529f\u80fd\u548c\u8d44\u4ea7\u4f18\u5316\u914d\u7f6e\u529f\u80fd\u3002\u6295\u8d44\u4e0e\u6295\u673a\u662f\u76f8\u8f85\u76f8\u6210\u7684\uff0c\u6ca1\u6709\u4e86\u6295\u673a\uff0c\u90a3\u6295\u8d44\u4e5f\u96be\u4ee5\u751f\u5b58\u3002<br>  \u4ece2015\u5e74\u81f32017\u5e74\uff0c\u4e2d\u56fd\u6295\u8d44\u8005\u7ecf\u5386\u4e86\u53f2\u65e0\u524d\u4f8b\u7684\u80a1\u707e\u3001\u7ecf\u5386\u4e86\u96be\u4ee5\u5fcd\u53d7\u7684\u7194\u65ad\uff0c\u53c8\u7ecf\u5386\u4e86\u957f\u8fbe\u8fd1\u4e00\u5e74\u7684\u4f4e\u4f4d\u6a2a\u76d8\u3002\u5728\u8fd9\u6837\u4e00\u79cd\u4f24\u75d5\u7d2f\u7d2f\u3001\u5343\u521b<br><br>\u767e\u5b54\u7684\u5f31\u52bf\u4e2d\uff0c\u5b9e\u5728\u7ecf\u4e0d\u8d77\u6298\u817e\u3001\u7ecf\u4e0d\u8d77\u6307\u8d23\uff0c\u800c\u662f\u9700\u8981\u66f4\u591a\u7684\u5b89\u629a\u3001\u7406\u89e3\u3001\u6fc0\u52b1\uff0c\u9700\u8981\u4e00\u4e2a\u771f\u5b9e\u7684\u3001\u7a33\u4e2d\u6709\u8fdb\u7684\u5e02\u573a\u73af\u5883\u3002", "text": "\u4ef7\u503c\u6295\u8d44\u8fd8\u662f\u4ef7\u503c\u6295\u673a\uff1f420\u5143\u7684\u8d35\u5dde\u8305\u53f0\uff0c69.19\u5143\u7684\u4e1c\u963f\u963f\u80f6\uff0c91.63\u5143\u7684\u4e91\u5357\u767d\u836f\uff0c34.18\u5143\u7684\u683c\u529b\u7535\u5668\uff0c58.6\u5143\u7684\u7247\u4ed4\u7640\u53ca46.4\u5143\u7684\u5c0f\u5929\u9e45<br><br>\uff0c\u88ab\u4e3b\u6d41\u8d44\u91d1\u8ffd\u6367\u800c\u5c61\u521b\u65b0\u9ad8\u3002\u96be\u9053\u4e2d\u56fd\u80a1\u5e02\u552f\u6709\u559d\u9152\u5403\u836f\u7684\u4e2a\u80a1\u5c5e\u4e8e\u4ef7\u503c\u6295\u8d44\u6807\u7684\uff1f\u90a3\u4e48\u4e2d\u56fd\u7684\u5236\u9020\u4e1a\u53d1\u5c55\u5728\u54ea\u91cc\uff1f\u4e2d\u56fd\u7684\u65b0\u5174\u4ea7\u4e1a\u5728\u54ea\u91cc\uff1f\u4e2d<br><br>\u56fd\u7684\u79d1\u6280\u9886\u5148\u5728\u54ea\u91cc\uff1f\u4e2d\u56fd\u7684\u4e92\u8054\u7f51\u3001\u667a\u80fd\u673a\u5668\u4eba\u5728\u54ea\u91cc\uff1f\u65b0\u5174\u4ea7\u4e1a\u7684\u9ad8\u4f30\u503c\u5c31\u4e0d\u5177\u5408\u7406\u6027\uff1f\u53d7\u5404\u79cd\u653f\u7b56\u6276\u6301\u53ca\u7ecf\u6d4e\u53d1\u5c55\u800c\u4ea7\u751f\u7684\u6982\u5ff5\u3001\u70ed\u70b9\u3001\u9898<br><br>\u6750\uff0c\u5728\u80a1\u5e02\u4e2d\u7684\u53cd\u6620\u5c31\u5168\u662f\u6295\u673a\u56e0\u7d20\uff1f\u5c31\u6ca1\u6709\u6295\u8d44\u7684\u6210\u4efd\uff1f\u80a1\u5e02\u662f\u7092\u672a\u6765\u7684\uff0c\u4e0d\u662f\u7092\u6628\u5929\u548c\u4eca\u5929\u7684\u3002\u5982\u679c\u5747\u6309\u5e02\u76c8\u7387\u3001\u5e02\u51c0\u7387\u5206\u6790\uff0c\u800c\u9760\u4f01\u4e1a\u5206\u7ea2<br><br>\u56de\u62a5\u5747\u8c08\u4e0d\u4e0a\u6295\u8d44\u4ef7\u503c\uff1f\u4e00\u4e2a\u4e0a\u5e02\u516c\u53f8\u7684\u4ef7\u503c\u4e0d\u4ec5\u6709\u4f01\u4e1a\u5c5e\u6027\u7684\u56e0\u7d20\uff0c\u4e5f\u6709\u5e02\u573a\u5c5e\u6027\u7684\u56e0\u7d20\u3002\u652f\u6301\u4f01\u4e1a\u53d1\u884c\u4e0a\u5e02\uff0c\u4e0d\u4ec5\u4ec5\u662fIPO\u5ba1\u6279\u4e86\u4e8b\uff0c\u8fd8\u9700\u8981<br><br>\u8ba9\u5176\u5728\u4e8c\u7ea7\u5e02\u573a\u4e0a\u53d1\u6325\u518d\u878d\u8d44\u529f\u80fd\u548c\u8d44\u4ea7\u4f18\u5316\u914d\u7f6e\u529f\u80fd\u3002\u6295\u8d44\u4e0e\u6295\u673a\u662f\u76f8\u8f85\u76f8\u6210\u7684\uff0c\u6ca1\u6709\u4e86\u6295\u673a\uff0c\u90a3\u6295\u8d44\u4e5f\u96be\u4ee5\u751f\u5b58\u3002<br>  \u4ece2015\u5e74\u81f32017\u5e74\uff0c\u4e2d\u56fd\u6295\u8d44\u8005\u7ecf\u5386\u4e86\u53f2\u65e0\u524d\u4f8b\u7684\u80a1\u707e\u3001\u7ecf\u5386\u4e86\u96be\u4ee5\u5fcd\u53d7\u7684\u7194\u65ad\uff0c\u53c8\u7ecf\u5386\u4e86\u957f\u8fbe\u8fd1\u4e00\u5e74\u7684\u4f4e\u4f4d\u6a2a\u76d8\u3002\u5728\u8fd9\u6837\u4e00\u79cd\u4f24\u75d5\u7d2f\u7d2f\u3001\u5343\u521b<br><br>\u767e\u5b54\u7684\u5f31\u52bf\u4e2d\uff0c\u5b9e\u5728\u7ecf\u4e0d\u8d77\u6298\u817e\u3001\u7ecf\u4e0d\u8d77\u6307\u8d23\uff0c\u800c\u662f\u9700\u8981\u66f4\u591a\u7684\u5b89\u629a\u3001\u7406\u89e3\u3001\u6fc0\u52b1\uff0c\u9700\u8981\u4e00\u4e2a\u771f\u5b9e\u7684\u3001\u7a33\u4e2d\u6709\u8fdb\u7684\u5e02\u573a\u73af\u5883\u3002", "news_id": "weibo", "id": 5126, "timestamp": 42847}
{"content": "\u5929\u5929\u5ba3\u4f20\u4f60\u90a3\u7535\u89c6\u5267\uff0c\u7ed9\u81ea\u5df1\u6253\u62db\u724c", "text": "\u5929\u5929\u5ba3\u4f20\u4f60\u90a3\u7535\u89c6\u5267\uff0c\u7ed9\u81ea\u5df1\u6253\u62db\u724c", "news_id": "weibo", "id": 5127, "timestamp": 42847}
{"content": "\u8d2a\u6c61\u7684\u662f\u4eba\u6c11\u5e01\uff0c\u4f60\u4e5f\u7528\u4eba\u6c11\u5e01\u3002\u4f60\u81ea\u5df1\u60f3\u4eba\u6c11\u5e01\u548c\u4eba\u6c11\u5e01\u6709\u4ec0\u4e48\u533a\u522b\uff1f\u8981\u60f3\u6ca1\u5f71\u54cd\uff0c\u9664\u975e\u4f60\u7528\u7684\u7f8e\u5143", "text": "\u8d2a\u6c61\u7684\u662f\u4eba\u6c11\u5e01\uff0c\u4f60\u4e5f\u7528\u4eba\u6c11\u5e01\u3002\u4f60\u81ea\u5df1\u60f3\u4eba\u6c11\u5e01\u548c\u4eba\u6c11\u5e01\u6709\u4ec0\u4e48\u533a\u522b\uff1f\u8981\u60f3\u6ca1\u5f71\u54cd\uff0c\u9664\u975e\u4f60\u7528\u7684\u7f8e\u5143", "news_id": "weibo", "id": 5128, "timestamp": 42847}
{"content": "\u8bc1\u5238\u5c0f\u5b98\u5de8\u8d2a\u8ba9\u4e2d\u56fd\u7684\u80a1\u6c11\u60c5\u4f55\u4ee5\u582a\uff1f", "text": "\u8bc1\u5238\u5c0f\u5b98\u5de8\u8d2a\u8ba9\u4e2d\u56fd\u7684\u80a1\u6c11\u60c5\u4f55\u4ee5\u582a\uff1f", "news_id": "weibo", "id": 5129, "timestamp": 42847}
{"content": "\u4e0d\u6015\u8d2a\u5b98\u660e\u8d2a\uff0c\u5c31\u6015\u8d2a\u5b98\u6709\u6280\u5de7\uff0c\u6709\u65b9\u6cd5\u7684\u8d2a\u2026", "text": "\u4e0d\u6015\u8d2a\u5b98\u660e\u8d2a\uff0c\u5c31\u6015\u8d2a\u5b98\u6709\u6280\u5de7\uff0c\u6709\u65b9\u6cd5\u7684\u8d2a\u2026", "news_id": "weibo", "id": 5130, "timestamp": 42847}
{"content": "\u660e\u663e\u7684\u5ba1\u6279\u6f0f\u6d1e", "text": "\u660e\u663e\u7684\u5ba1\u6279\u6f0f\u6d1e", "news_id": "weibo", "id": 5131, "timestamp": 42847}
{"content": "\u77e5\u8db3\u5427\uff0c\u6211\u8840\u672c\u65e0\u5f52\u4e86[/\u5927\u54ed]", "text": "\u77e5\u8db3\u5427\uff0c\u6211\u8840\u672c\u65e0\u5f52\u4e86[/\u5927\u54ed]", "news_id": "weibo", "id": 5132, "timestamp": 42847}
{"content": "\u80a1\u5e02\u660e\u660e\u662f\u5e02\u573a\u7ecf\u6d4e\u7684\u6700\u9ad8\u5f62\u5f0f\uff0c\u662f\u89c4\u8303\u5316\u3001\u6cd5\u5236\u5316\u3001\u56fd\u9645\u5316\u7684\u91cd\u8981\u573a\u6240\uff0c\u8fd1\u671f\u80a1\u5e02\u4e00\u591c\u4e4b\u95f4\u53c8\u56de\u5230\u4e86\u8ba1\u5212\u7ecf\u6d4e,\u8dcc\u8981\u7ba1\u3001\u6da8\u4e5f\u8981\u7ba1\uff0cIPO\u8981\u7ba1\u3001<br><br>\u5206\u7ea2\u8981\u7ba1\u3001\u9ad8\u9001\u8f6c\u8981\u7ba1\uff0c\u5e76\u8d2d\u91cd\u7ec4\u8981\u7ba1,\u6982\u5ff5\u8981\u7ba1\u3001\u70ed\u70b9\u4e5f\u8981\u7ba1\u3002\u4e2d\u56fd\u7ecf\u6d4e\u6b63\u5904\u4e8e\u4fc3\u8f6c\u578b\u3001\u8c03\u7ed3\u6784\u3001\u7a33\u589e\u957f\u7684\u9636\u6bb5\uff0c\u653f\u5e9c\u529b\u6c42\u51cf\u5c11\u884c\u653f\u675f\u7f1a\uff0c\u51cf\u5c11<br><br>\u7a0e\u6536\u3001\u7b80\u653f\u653e\u6743\u3001\u653e\u5f00\u5e02\u573a\uff0c\u8fd9\u5c31\u662f\u6240\u8c13\u7684\u201c\u5c0f\u653f\u5e9c\u3001\u5927\u5e02\u573a\u201d\uff0c\u800c\u5982\u4eca\u7684\u4e2d\u56fd\u80a1\u5e02\u5ffd\u7136\u4ee4\u4eba\u89c9\u5f97\u53d8\u6210\u4e86\u5927\u653f\u5e9c\u3001\u5c0f\u5e02\u573a\u3002\u4e2d\u56fd\u80a1\u5e02\u4ec0\u4e48\u65f6\u5019\u6210\u4e86<br><br>\u8ba1\u5212\u7ecf\u6d4e\u7684\u6700\u9ad8\u5f62\u5f0f\uff0c\u662f\u524d\u8fdb\u8fd8\u662f\u5012\u9000\uff1f", "text": "\u80a1\u5e02\u660e\u660e\u662f\u5e02\u573a\u7ecf\u6d4e\u7684\u6700\u9ad8\u5f62\u5f0f\uff0c\u662f\u89c4\u8303\u5316\u3001\u6cd5\u5236\u5316\u3001\u56fd\u9645\u5316\u7684\u91cd\u8981\u573a\u6240\uff0c\u8fd1\u671f\u80a1\u5e02\u4e00\u591c\u4e4b\u95f4\u53c8\u56de\u5230\u4e86\u8ba1\u5212\u7ecf\u6d4e,\u8dcc\u8981\u7ba1\u3001\u6da8\u4e5f\u8981\u7ba1\uff0cIPO\u8981\u7ba1\u3001<br><br>\u5206\u7ea2\u8981\u7ba1\u3001\u9ad8\u9001\u8f6c\u8981\u7ba1\uff0c\u5e76\u8d2d\u91cd\u7ec4\u8981\u7ba1,\u6982\u5ff5\u8981\u7ba1\u3001\u70ed\u70b9\u4e5f\u8981\u7ba1\u3002\u4e2d\u56fd\u7ecf\u6d4e\u6b63\u5904\u4e8e\u4fc3\u8f6c\u578b\u3001\u8c03\u7ed3\u6784\u3001\u7a33\u589e\u957f\u7684\u9636\u6bb5\uff0c\u653f\u5e9c\u529b\u6c42\u51cf\u5c11\u884c\u653f\u675f\u7f1a\uff0c\u51cf\u5c11<br><br>\u7a0e\u6536\u3001\u7b80\u653f\u653e\u6743\u3001\u653e\u5f00\u5e02\u573a\uff0c\u8fd9\u5c31\u662f\u6240\u8c13\u7684\u201c\u5c0f\u653f\u5e9c\u3001\u5927\u5e02\u573a\u201d\uff0c\u800c\u5982\u4eca\u7684\u4e2d\u56fd\u80a1\u5e02\u5ffd\u7136\u4ee4\u4eba\u89c9\u5f97\u53d8\u6210\u4e86\u5927\u653f\u5e9c\u3001\u5c0f\u5e02\u573a\u3002\u4e2d\u56fd\u80a1\u5e02\u4ec0\u4e48\u65f6\u5019\u6210\u4e86<br><br>\u8ba1\u5212\u7ecf\u6d4e\u7684\u6700\u9ad8\u5f62\u5f0f\uff0c\u662f\u524d\u8fdb\u8fd8\u662f\u5012\u9000\uff1f", "news_id": "weibo", "id": 5133, "timestamp": 42847}
{"content": "\u90fd\u50cf\u8fd9\u6837\u5c31\u6ca1\u6709\u8fd9\u90e8\u7535\u89c6\u5267\u4e86", "text": "\u90fd\u50cf\u8fd9\u6837\u5c31\u6ca1\u6709\u8fd9\u90e8\u7535\u89c6\u5267\u4e86", "news_id": "weibo", "id": 5134, "timestamp": 42847}
